import React from "react";



export const Button = (props) => {

    const styles= {
        backgroundColor: props.color || "#ffc107",
        borderRadius: "6px",
        cursor: "pointer",
        outline: "none",
        border: "none",
        padding: "5px 15px",
        fontSize: "16px",

        ":hover": {
            backgroundColor: "#000",
        }
    }

    return <>
        <button style={styles}>{props.text}</button>
    </>

}
